(1, '新津宝墩', '新津宝墩城位于新津县龙马乡宝墩村,俗称“龙马古城”,当地老百姓传说是三国时期诸葛亮七擒孟获的“孟获城”。平面为长方形，南北长1100米，东西长600米，面积达60万平方米。城墙中下部为堆筑，并使用了板或木棍之类的夯筑工具，城内发现方形木骨泥墙建筑。', '四川大学考古学系', 1, '2015-06-28 22:45:48'),
